import React, { useState } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";

function ContactForm() {
  const [formData, setFormData] = useState({
    name: "",
    contact: "",
    collegeName: "",
    festName: "",
    festDetails: "",
    socialMedia1: "",
    socialMedia2: "",
    socialMedia3: "",
  });

  const [position, setPosition] = useState([51.505, -0.09]); // Replace with your default map coordinates

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Implement your form submission logic here
    console.log("Form Data:", formData);
  };

  return (
    <div>
      <h2>Contact Us</h2>
      <div className="contact-map">
        <MapContainer
          center={position}
          zoom={13}
          style={{ height: "400px", width: "100%" }}
        >
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
          />
          <Marker position={position}>
            <Popup>Your Location</Popup>
          </Marker>
        </MapContainer>
      </div>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="name">Name</label>
          <input
            type="text"
            id="name"
            name="name"
            value={formData.name}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="contact">Contact</label>
          <input
            type="tel"
            id="contact"
            name="contact"
            value={formData.contact}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="collegeName">College Name</label>
          <input
            type="text"
            id="collegeName"
            name="collegeName"
            value={formData.collegeName}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="festName">Fest Name</label>
          <input
            type="text"
            id="festName"
            name="festName"
            value={formData.festName}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="festDetails">Fest Details</label>
          <textarea
            id="festDetails"
            name="festDetails"
            value={formData.festDetails}
            onChange={handleInputChange}
            required
          ></textarea>
        </div>
        <div className="form-group">
          <label htmlFor="socialMedia1">Social Media 1</label>
          <input
            type="url"
            id="socialMedia1"
            name="socialMedia1"
            value={formData.socialMedia1}
            onChange={handleInputChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="socialMedia2">Social Media 2</label>
          <input
            type="url"
            id="socialMedia2"
            name="socialMedia2"
            value={formData.socialMedia2}
            onChange={handleInputChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="socialMedia3">Social Media 3</label>
          <input
            type="url"
            id="socialMedia3"
            name="socialMedia3"
            value={formData.socialMedia3}
            onChange={handleInputChange}
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default ContactForm;
